(1, 1, '2017-10-25 23:27:14', '2017-10-25 23:27:14', 'As a founder, product lead at Pinterest and PM for a couple products at Google, as well as a growth partner for Initialized Capital, Ive seen many product teams struggle to grow. Many products start out with a bang. Some find product-market fit with sustained growth. A few have gone through spurts of hyper-growth. But more often than not, Ive seen most of them linger then fizzle.\r\n<blockquote>Founders launch their product, wonder why it isnt growing like gangbusters and then immediately try to fix their growth problem.</blockquote>\r\nThey turn to growth tactics like optimizing their on-boarding funnel, SEO or push notifications before really understanding what they are building and who they are building for. This may create an initial burst of short-term growth.\r\n\r\nBut it ultimately leads to high churn of your possible customers, while ignoring problems in the core product.\r\nBefore trying different growth tactics like throwing spaghetti at a wall, startups need to take a fresh look at their users, evaluate their product end goals and re-define the journey they want their users to take to get there. Here are some tips that can help define a path which will clarify the different steps needed to unlock product growth.', 'What to do if tour product isnt growing', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2017-10-26 04:35:32', '2017-10-26 04:35:32', '', 0, 'http://127.0.0.1/nyobakpapat/?p=1', 0, 'post', '', 1),
(2, 1, '2017-10-25 23:27:14', '2017-10-25 23:27:14', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://127.0.0.1/nyobakpapat/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2017-10-25 23:27:14', '2017-10-25 23:27:14', '', 0, 'http://127.0.0.1/nyobakpapat/?page_id=2', 0, 'page', '', 0),
