(112, 1, '2017-10-26 04:36:17', '2017-10-26 04:36:17', 'Enterprise applications are complexthere is an insane amount of information that is to be displayed that contains data from various sources, modules and users. There are complex graphs, usage patterns, and lists of data that need to be skimmed through before one can make sense of what the console is getting at.\r\n<blockquote>The biggest challenge with designing enterprise applications is the lack of examples of patterns that work or dont work in specific scenarios.</blockquote>\r\nSince most enterprise applications contain sensitive data pertaining to the company, there are very few examples out there that talk to some of the common problems faced while designing enterprise apps. There exists pattern libraries that talk in-depth about how each component should work but very little on when to use them. The patterns we see in design libraries are often oversimplified and does not work in real enterprise applications where data and the use-cases are more complex in nature.\r\n\r\nWhat you see below is a typical enterprise application. The working window is dense with information with a crazy number of panels each indicating information that is contextual to any other selection made on the screen.', 'One thing separates creators from consumers', '', 'publish', 'open', 'open', '', 'one-thing-separates-creators-from-consumers', '', '', '2017-10-26 04:37:51', '2017-10-26 04:37:51', '', 0, 'http://127.0.0.1/nyobakpapat/?p=112', 0, 'post', '', 0),
(114, 1, '2017-10-26 04:38:59', '2017-10-26 04:38:59', 'There are certain topics that even some of the smartest people I talk with who arent startup oriented cant fully grok. One of them is whether profitability matters. Its common cocktail party chatter to hear people confidently pronounce that some well known startup is sure to blow up.\r\n\r\nOr you know the other onethe one where Snapchat lost $2 billion in just one quarter. Two-fucking-billion! What a disaster! Except that they didnt actually lose $2 billion in cash. It was a stock option incentive related expense but I bet you didnt know that because in an era where we only read the headlinesthey must be a train wreck losing billions. (They actually lost about $175 million in cash in that quarter, FWIW. See appendix if you want to know more on this.)\r\n<blockquote>How could they succeed when theyre not even profitable!</blockquote>\r\nIf you hire 6 senior sales reps in January at $120,000 / year salary then youve taken on an extra $60,000 per month in costs yet these sales people might not close new business for 6 months. Your profitability will go down for 2 quarters while your growth may increase dramatically in quarters 312.\r\nI know this seems obvious but I promise you that even smart people forget this when talking about profitability. 7080% of the costs of most startups are employee costs so what youre really talking about when a company is unprofitable is that they are growing their staff ahead of their revenue.', 'Should startups care about profitability?', '', 'publish', 'open', 'open', '', 'should-startups-care-about-profitability', '', '', '2017-10-26 04:38:59', '2017-10-26 04:38:59', '', 0, 'http://127.0.0.1/nyobakpapat/?p=114', 0, 'post', '', 0),
